import React from 'react';
import './App.css';
import { Button, Divider, Form, Grid, Segment } from 'semantic-ui-react'
import 'semantic-ui-css/semantic.min.css'



function App() {
  return (
    <Grid container columns={3} divided relaxed stackable>
      <Grid.Column>
      <Header as='h3' textAlign='center'>
    Cash - $
    </Header>
      <Input type="text" id='ticker' placeholder='Ticker' onChange={this.handleChange}
      value={this.state.ticker}
      />
      <br/>
      <Input type="number" id='quantity' placeholder='Qty' style={{padding: "10px"}}  onChange={this.handleChange} value={this.state.quantity}/>
      <br/>
      <Button  disabled={this.activeButton()} style={{backgroundColor: "#44829e", color: "white", width: "181.79px"}}  onClick={this.handleClick}>Buy</Button>
      {this.inputWarning()}
      </Grid.Column>

      <Grid.Column verticalAlign='middle'>
        <Button content='Sign up' icon='signup' size='big' />
      </Grid.Column>
      <Grid.Column verticalAlign='middle'>
        <Button content='Sign up' icon='signup' size='big' />
      </Grid.Column>
    </Grid>
  );
}

export default App;
